import React from "react";
import AboutMe from "../Img/about.jpg";
import "./About.css";
const About = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col bg-danger">Ricardo</div>
        <div className="col-6 bg-info p-2">
          <img className="img-fluid  img-thumbnail" src={AboutMe} />
          <div className="row">
            <div className="cd-none col-lg-12">
              Soy una persona que encontro su verdadera pacion. Me emociona
              aprender
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default About;
